import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { majorDetailService } from '../../services/majorDetailService';
import '../../styles/pages/major-detail.css';

const AcademicMajorPage = () => {
    const { code } = useParams();
    const navigate = useNavigate();
    const [majorDetail, setMajorDetail] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchMajorDetail = async () => {
            try {
                setLoading(true);
                setError(null);
                console.log('Fetching data for code:', code); // Debug log
                const response = await majorDetailService.getMajorDetailByCode(code);
                console.log('Raw API response:', response); // Debug log

                if (!response) {
                    throw new Error(`Không tìm thấy thông tin ngành học với mã: ${code}`);
                }

                // Trực tiếp sử dụng response vì response.data có thể undefined
                const majorData = response;
                console.log('Processed major data:', majorData); // Debug log

                setMajorDetail({
                    name: majorData.major_name || majorData.name || 'Chưa cập nhật',
                    code: majorData.major_code || majorData.code || code,
                    examBlocks: Array.isArray(majorData.exam_groups) 
                        ? majorData.exam_groups.join(', ')
                        : majorData.exam_groups || 'Chưa cập nhật',
                    benchmarkScore: majorData.benchmark_score || 'Chưa cập nhật',
                    tuitionFee: majorData.tuition_fee || 'Chưa cập nhật',
                    duration: majorData.duration || 'Chưa cập nhật',
                    degree: majorData.degree || 'Chưa cập nhật',
                    employmentRate: majorData.employment_rate || 'Chưa cập nhật',
                    demandLevel: majorData.demand_level || 'Chưa cập nhật',
                    startingSalary: majorData.starting_salary || 'Chưa cập nhật',
                    studyAbroadOpportunity: majorData.study_abroad_opportunity || 'Có',
                    description: majorData.description || 'Chưa có thông tin',
                    curriculum: Array.isArray(majorData.curriculum) ? majorData.curriculum : [],
                    careerProspects: Array.isArray(majorData.career_prospects) ? majorData.career_prospects : [],
                    universities: Array.isArray(majorData.universities) ? majorData.universities : [],
                    ranking: majorData.ranking || null,
                    salaryRange: majorData.salary_range || 'Chưa cập nhật',
                    jobOpportunities: majorData.job_opportunities || 'Chưa có thông tin'
                });
            } catch (err) {
                console.error('Error details:', err);
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };

        if (code) {
            fetchMajorDetail();
        }
    }, [code]);

    if (loading) {
        return (
            <div className="loading-container">
                <div className="loading">Đang tải thông tin ngành học...</div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="error-container">
                <div className="error">
                    <h2>Có lỗi xảy ra</h2>
                    <p>{error}</p>
                    <button onClick={() => navigate('/search/majors')}>
                        Quay lại trang tìm kiếm
                    </button>
                </div>
            </div>
        );
    }

    if (!majorDetail) return <div className="error">Không tìm thấy thông tin ngành học</div>;

    return (
        <div className="academic-major-page">
            <section className="academic-major-header">
                <h1>{majorDetail.name}</h1>
                <div className="academic-major-meta">
                    <span>🔢 Mã ngành: {majorDetail.code}</span>
                    {majorDetail.examBlocks && <span>📚 Khối thi: {majorDetail.examBlocks}</span>}
                    {majorDetail.benchmarkScore && <span>🎯 Điểm chuẩn: {majorDetail.benchmarkScore}</span>}
                    {majorDetail.tuitionFee && <span>💰 Học phí: {majorDetail.tuitionFee}</span>}
                    {majorDetail.ranking && <span>⭐ {majorDetail.ranking}</span>}
                </div>
            </section>

            <div className="academic-major-content">
                <aside className="academic-major-sidebar">
                    <div className="major-info-card">
                        <h3>Thông tin cơ bản</h3>
                        <ul>
                            <li>Thời gian đào tạo: {majorDetail.duration}</li>
                            <li>Văn bằng: {majorDetail.degree}</li>
                            <li>Thu nhập: {majorDetail.salaryRange}</li>
                        </ul>
                    </div>
                </aside>

                <main className="major-main">
                    <section className="major-description">
                        <h2 className="section-title">Giới thiệu ngành</h2>
                        <div dangerouslySetInnerHTML={{ __html: majorDetail.description?.replace(/\n/g, '<br/>') }} />
                    </section>

                    <section className="career-prospects">
                        <h2 className="section-title">Cơ hội nghề nghiệp</h2>
                        <div dangerouslySetInnerHTML={{ __html: majorDetail.jobOpportunities?.replace(/\n/g, '<br/>') }} />
                    </section>
                </main>
            </div>
        </div>
    );
};

export default AcademicMajorPage;
